import './App.css';
import Input from './Input';
import Add from './Add';
import { useState } from 'react';
useState
function App() {
  const [text,setText] = useState('');
  const handlechange = (e) =>
  {
    setText(e.target.value);
  }
  return (
    <div>
      <h1 className="Head">To Do List</h1>

       <Input text={text} handlechange={handlechange}/>

       <Add/>
    </div>
  );
}

export default App;
